import React from 'react';
import {
  Form, Input, Button
} from 'antd';

const Forma = () => {
  const onFinish = () => {
    console.log('values');
  }

  const validate = (_, value) => {
    console.log(value);
  }
  return (
    <Form name="nest" onFinish={onFinish}>
      <Form.Item
        name="firstName"
        label="First name"
        rules={[{ required: true, type: 'string' }, {
          pattern: new RegExp("/^[A-Z@~`!@#$%^&*()_=+\\\\';:\"\\/?>.<,-]*$/i"),
          message: 'field does not accept numbers'
        }]}
      >
        <Input />
      </Form.Item>
      <Form.Item name="lastName" label="Last name" rules={[{ required: true, type: 'string', validate }]}>
        <Input />
      </Form.Item>
      <Form.Item>
        <Button type="primary" htmlType="submit">
          Submit
        </Button>
      </Form.Item>
    </Form>
  );
}
export default Forma;
